css:
.conflict-resolved {
  background: rgba(255, 255, 255, 0.07);
}
.conflict-ours {
  background: #207b4a;
}
.conflict-ours.cursor-line {
  background: #155231;
}
.conflict-theirs {
  background: #146297;
}
.conflict-theirs.cursor-line {
  background: #0e456a;
}
.conflict-dirty {
  background: #433d03;
}
.conflict-dirty.cursor-line {
  background: #746a05;
}
